import TextField, { TextFieldVariants } from "@mui/material/TextField";

type TextInputProps = {
  label: string;
  fullwidth?: boolean;
  variant?: TextFieldVariants;
  type?: string;
};

export const TextInput = ({
  label,
  fullwidth,
  variant,
  type,
}: TextInputProps) => {
  return <TextField label={label} variant={variant} type={type} fullWidth />;
};
